post_text:
In case you missed it last week, new guidance was released on 6/18/20.
Californians must wear face coverings when they are:
> Inside of, or in line to enter, any indoor public space
> Obtaining services from the healthcare sector
> Waiting for or riding on public transportation or while in a taxi or ride-sharing vehicle
> In any enclosed area where people outside their own household are present and unable to physically distance
> Outdoors in public spaces when maintaining a physical distance is not feasible
> Engaged in work when:
• Interacting in-person with any member of the public;
• Working in any space visited by members of the public;
• Working where food is prepared or packaged for sale or distribution;
• Working in or walking through common areas;

For more info, including who is exempt from wearing a face covering according to the State Order, visit https://bit.ly/cdph61820

