post_text:
Essential Workers Keep Us Safe and Healthy!

@SCCOE, in partnership with community organizations and agencies throughout Santa Clara County, is coordinating childcare programs for essential workers.

Resources are available to connect essential workers as defined by the March 31st 2020 Order of the Health Officer of the County of Santa Clara, to childcare options throughout Santa Clara County. For more information, visit https://bit.ly/childcarescc

